import React from "react";

export default function TodosList() {

    const today = new Date();
    const targetDate = new Date(today.getFullYear(), today.getMonth() + 1, today.getDate());


	const todos = [
		{ id: 1, description: "aprende aws", done: false, targetDate: targetDate },
		{ id: 2, description: "aprende react", done: false, targetDate: targetDate },
		{ id: 3, description: "aprende node", done: false, targetDate: targetDate },
	];

	return <div className="ListTodoContainer">
        <h1>Lista de tareas</h1>
        <table>
            <thead>
                <tr>
                    <th>Id</th>
                    <th>Descripci√≥n</th>
                    <th> is Done</th>
                    <th>Target Date</th>
                </tr>
            </thead>
            <tbody>
                {todos.map(todo => (
                    <tr key={todo.id}>
                        <td>{todo.id}</td>
                        <td>{todo.description}</td>
                        <td>{todo.done.toString()}</td>
                        <td>{todo.targetDate.toString()}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    </div>;
}
